INSERT INTO warehouse.materials (material_id, name, description)
VALUES
    ('ffacb098-498c-4a94-b1e5-9a3f74af68bb', 'Gips', 'Gips is een zacht sulfaatmineraal bestaande uit calciumsulfaatdihydraat. Het wordt vaak gebruikt in de bouwsector voor de productie van gips, gipsplaat en cement. Gips wordt in de landbouw ook gebruikt als bodemverbeteraar en meststof.'),
    ('d2ed5e29-9e29-4fcd-a14b-27c31b9893c3', 'Ijzererts', 'IJzererts is een natuurlijk voorkomend mineraal waaruit ijzer wordt gewonnen. Het is een cruciale grondstof bij de productie van staal, dat op grote schaal wordt gebruikt in de bouw-, productie- en transportindustrie. Veel voorkomende soorten ijzererts zijn hematiet en magnetiet.'),
    ('d15d4ed9-0a79-4248-80c3-bfb4e6de2ff4', 'Cement', 'Cement is een bindmiddel dat in de bouw wordt gebruikt en dat uithardt en aan andere materialen hecht om ze samen te binden. Het is een belangrijk ingrediënt in beton, mortel en stucwerk. Portlandcement, gemaakt van kalksteen en klei, is het meest voorkomende type.'),
    ('946a2179-8a5f-4a3a-935f-924f156af91d', 'Petcode', 'Petcoke is een koolstofrijk vast materiaal afkomstig van olieraffinage. Vanwege de hoge calorische waarde wordt het gebruikt als brandstof bij energieopwekking, cementovens en andere industriële processen. Petcoke wordt ook gebruikt bij de productie van elektroden voor de aluminium- en staalindustrie.'),
    ('8c784ddc-6585-47cc-9e11-a5e59f2dba49', 'Slak', 'Slak is een bijproduct van het smeltproces dat wordt gebruikt om metalen uit hun ertsen te produceren. Het wordt in de bouw gebruikt als aggregaat in beton, in de wegenbouw en als grondstof bij de cementproductie. Slak helpt de duurzaamheid en sterkte van beton te verbeteren.');
